          this.newsinfo.click = 326;
          this.newsinfo.content = '<p style="text-indent: 2em">《深圳市住房公积金管理委员会关于调整住房公积金贷款首付款比例有关事项的通知》中明确提出，深圳市公积金贷款(包括商业性住房按揭贷款转住房公积金贷款)首付款比例执行为：住房公积金缴存职工家庭名下在本市无房，使用公积金贷款购买首套住房的，公积金贷款首付款比例最低为30%;职工家庭名下在本市拥有1套住房的，使用公积金贷款再次购房的，公积金贷款首付款比例不低于70%。</p><p style="text-indent: 2em">据市住房建设局公积金中心相关负责人介绍，职工家庭购买首套住房申请公积金贷款的，贷款利率仍为个人住房公积金贷款基准利率(5年以上为3.25%，5年及以下为2.75%);职工家庭名下在深圳已经拥有1套住房，再次购买住房时申请公积金贷款的，贷款利率为个人住房公积金贷款基准利率的1.1倍。购买第三套住房的不予申请公积金贷款。</p><p style="text-indent: 2em">明确在市区限购范围内，职工家庭购买首套普通自住住房，或拥有1套住房并已结清购房贷款的、为改善居住条件再次申请住房公积金贷款，首付款比例从不低于20%调整为不低于30%;拥有1套住房但未结清相应商业性购房贷款，再次申请住房公积金贷款购买普通自住住房的，首付款比例从不低于50%调整为不低于60%;拥有2套及以上住房或未结清住房公积金贷款的，不得申请住房公积金贷款。</p><p style="text-indent: 2em">明确在市区限购范围内，对于居民家庭首次购买普通住房(从未购置过住房且无购房贷款记录)的商业性个人住房贷款，最低首付款比例不低于30%;对于三种情形的居民家庭(申请贷款时实际没有住房但有购房贷款记录的居民家庭;拥有1套住房但没有购房贷款记录的居民家庭;拥有1套住房且相应购房贷款已结清的居民家庭)申请商业性个人住房贷款购买普通住房的，最低首付款比例调整为不低于40%;对于拥有1套住房且相应贷款未结清的居民家庭，再次申请商业性个人住房贷款购买普通住房的，最低首付款比例调整为不低于60%;对拥有2套及以上住房的居民家庭，暂停发放第3套及以上住房贷款。</p>';
